    await driver.findElement(By.css(".hover\\3A bg-gray-200:nth-child(1)")).click()
    await driver.findElement(By.id("btn6")).click()
    await driver.findElement(By.css(".flex-wrap:nth-child(3)")).click()
    await driver.findElement(By.css(".py-2")).click()
    await driver.findElement(By.name("document_type")).click()
    {
      const dropdown = await driver.findElement(By.name("document_type"))
      await dropdown.findElement(By.xpath("//option[. = 'Receipt of fee paid for residue testing']")).click()
    }
    await driver.findElement(By.css("option:nth-child(5)")).click()
    await driver.findElement(By.css(".mb-4:nth-child(2) > .w-full")).click()
    await driver.findElement(By.css(".mb-4:nth-child(2) > .w-full")).sendKeys("1")
    await driver.findElement(By.css(".mb-6 > .w-full")).click()
    await driver.findElement(By.css(".flex-1:nth-child(1)")).click()
    assert(await driver.switchTo().alert().getText() == "Failed to upload document. Please try again.")
    await driver.findElement(By.css(".flex-1:nth-child(1)")).click()
    assert(await driver.switchTo().alert().getText() == "Failed to upload document. Please try again.")
